import React, { Fragment } from "react";


const SeriseCard = ()=>(
  <div className="col-lg-2 col-md-3 col-sm-4 col-6">
    <div className="card">
      <div className="card-image">
        <img src="" />
      </div>
    </div>
  </div>
)

function HeadSection(props) {
  return (
    <Fragment>
      <div className="row">
        {[...Array(10).keys()].map(val=><SeriseCard/>)}
      </div>
    </Fragment>
  );
}


export default HeadSection;
